INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222475958410', 'Cheeseburger', 'Pain spécial au _sésame_ 36,6% (farine de _blé_ - eau - dextrose - levure - huile de tournesol - graines de _sésame_ 0,5% - sel - farine de fève - émulsifiants : E482, E471 - agents de traitement de la farine : acide ascorbique, L-cystéine) - préparation à base de viande bovine hâchée cuite 34,5% [viande bovine 34,1% (origine France) - sel - arômes] - _fromage_ fondu 12,4% (_fromages_ - eau - _beurre_ - protéines de _lait_ - amidon transformé de maïs - _lactosérum_ - sels de fonte : citrates de sodium - gélifiant : carraghénanes) - tomato ketchup (concentré de tomates - sirop de glucose-fructose - vinaigre d\'alcool - sucre - amidon transformé de maïs - sel - acidifiant : acide lactique - épices) - cornichons 2,7% (cornichons 2,6% - eau - vinaigre d\'alcool - sel - conservateur : _disulfite_ de potassium - affermissant : chlorure de calcium) - huile de colza - _moutarde_ (eau - graines de _moutarde_ - vinaigre d\'alcool - sel - épices - arômes - conservateur : _sulfite_ acide de sodium) - cornichons 0,96% (cornichons 0,95% - vinaigre d\'alcool - sel) - sucre - amidon transformé de maïs - vinaigre d\'alcool - concentré de tomates - oignons déshydratés - sel - conservateur : sorbate de potassium - arôme naturel - colorant : extrait de paprika. Traces de _poissons_, _œuf_, _soja_ et _fruits à coque_.', 'https://static.openfoodfacts.org/images/products/322/247/595/8410/front_fr.5.400.jpg', '12', '5.3', '22', '4.5', '1.7', '14', '1.2', '0.47244094488189', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3222475958427', 'Maxi bacon cheeseburger', 'Pain spécial au sésame 43,6% (farine de _blé_ - eau - levure - dextrose - huile de colza - _gluten_ de _blé_ - sucre - _graines de sésame_ 0,7% - sel - farine de fève - conservateur : propionate de calcium - émulsifiants : E471, E472e - agent de traitement de la farine : acide ascorbique) - produit à base de viande bovine hachée cuit 25,6% (viande bovine hachée 25,3% - sel - arômes) - _edam_ 12,8% (_lait_ de vache - sel - ferments lactiques - enzyme coagulante - colorant : rocou) - mayonnaise allégée en matières grasses [eau - huile de colza - vinaigre d\'alcool - jaune d\'_œuf_ - amidon transformé - sucre - _moutarde_ de Dijon (eau - graines de _moutarde_ - vinaigre d\'alcool - sel) - sel - _lait_ écrémé reconstitué - acidifiant : acide citrique - épaississant : gomme xanthane] - poitrine de porc fumée grillée 6,1% (viande de porc - eau - sel - antioxydant : ascorbate de sodium - conservateur : nitrite de sodium) - cornichons 2,05% (cornichons 2,02% - eau - vinaigre d\'alcool - sel - conservateur : disulfite de potassium - affermissant : chlorure de calcium) - tomato ketchup (concentré de tomate - sirop de glucose-fructose - vinaigre d\'alcool - sucre - amidon transformé - sel - acidifiant : acide lactique - épices) - huile de colza - _moutarde_ (eau - graines de _moutarde_ - vinaigre d\'alcool - sel - épice - arômes - conservateur : sulfite acide de sodium) - cornichons 0,14% (cornichons 0,13% - vinaigre - sel) - sucre - amidon transformé - fécule de manioc - vinaigre d\'alcool - concentré de tomates - oignons - sel - conservateur : sorbate de potassium - arôme naturel - colorant : extrait de paprika. Traces de _poissons_, _soja_ et _fruits à coque_. Viande bovine origine : France - porc origine : UE.', 'https://static.openfoodfacts.org/images/products/322/247/595/8427/front_fr.4.400.jpg', '15', '5.8', '22', '3.7', '', '16', '1.4', '0.551181102362205', '', '0');

