VALUES ('3222476601254', 'Sel de Guérande', 'ÇA VIENT d\'ICI sel de Guérande Notre sel Casino Ça Vient d\'ici est récolté à Guérande en Loire. Atlantique l\'été, quand la météo clé. mente associe vent et soleil, sous l\'effet de l\'évaporation, l\'eau de mer se cristallise pour devenir du sel... Le sel de Guérande trouve ses racines dans l\'histoire, on le récolte selon une méthode manuelle traditionnelle depuis plus de 1000 ans. Ce sel fin de Guérande est non raffiné, sans additif, juste séché et broyé.', 'https://static.openfoodfacts.org/images/products/322/247/660/1254/front_fr.4.400.jpg', '0', '0', '0', '0', '0', '0', '98.425', '38.75', '', '0');

